export default (function(a,b,c){return {data:{ws5cDeNQCT:{data:{id:878,attributes:{imdbId:"tt1199552",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzE3MTk4ODEtNzU0Ny00YjA2LWJiYjctYWM1YmRiNjUxZjY2XkEyXkFqcGdeQXVyMTgxNzA4MTM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.2\u002F10"}],item_lang:{data:{id:1541,attributes:{title:b,plot:"This is the story of a slave boy and his dog who escape the master's plantation, join the Union Army, and have to face their former master on the battlefield. The story is inspired by the historical true-life adventures of the beloved mascot of the Pennsylvania 102nd, who was so prized by his regiment for his skills in battle, that he was twice exchanged for a Confederate prisoner of war.",slug:"dog-jack"}}},books:{data:[{id:5359,attributes:{title:b,description:"The Heartwarming story of a runaway slave and his best friend.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=e_ZaAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Florence W. Biros"],firstBook:true,published:"1999-05-01",publisher:"Son Rise Publications",subtitle:a}},{id:5360,attributes:{title:"Dog Jack Study Guide",description:"Dog Jack was the mascot of the 102nd Regiment P. V. V. Washington Infantry during the Civil War. Jack was with his regiment from 1861 to 1863 until he became a prisoner of war. He was captured by the Confederate Army at Salem Church, Virginia, and later exchanged for a Confederate soldier. In this remarkable novel, Florence Biros trasports you back in time with the heartwarming story of a runaway slave boy and his loyal dog. It is also a story of the love and allegiance of the men of the Niagra Volunteers to their mascot and companion, \"Dog Jack.\" This study guide goes along with the novel.",thumbnail:a,authors:["Biros Florence"],firstBook:c,published:"2001-06-12",publisher:a,subtitle:a}},{id:5361,attributes:{title:b,description:"DOG JACK, real-life mascot of the 102nd Regiment of the Pennsylvania Volunteers, finds his way into the hearts of young readers as they learn of his experiences during the Civil War as told by Florence W. Biros in the novel bearing his name. The actual historic events known about this canine hero are interwoven into this saga of love & adventure about Jed, a runaway slave boy, & his canine companion & friend. The story also shares of the allegiance of the men of the Niagara Volunteers toward their loyal mascot. DOG JACK, 192 page trade paper, is illustrated by a cover portrait by famed artist Ron DiCianni; the final pages are filled with a LIVING HISTORY GALLERY--actual photographs of the reenactment of the 125th Anniversary of the Battle of Gettysburg. DOG JACK, published by Son-Rise Publications, Route 3, Box 202, New Wilmington, PA 16142 retails for $7.95. Son-Rise phone number: (412) 946-8334.",thumbnail:a,authors:["Florence K. Biros"],firstBook:c,published:"1988-11-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940958668}}("","Dog Jack",null))